descriptions:
{'es-ES': 'En MUEZ, un pueblo pequeño y coqueto, con un núcleo urbano bien cuidado y llamativo por la tierra rojiza de sus contrucciones. Rodeado de una naturaleza exuberante (Parque Natural de las Sierras de Urbasa y Andía), se encuentra este chalet con todas las comodidades que necesitas; para vivir o para invertir como casa rural. ¡Tú decides!

Cuenta con 3 plantas distribuidas en 2 salones, cada uno de ellos con chimena; un comedor grande, 3 cocinas, 5 habitaciones, 5 baños, 3 terrazas, garaje para 2 coches y un jardin que rodea toda la casa. 

La calefacción es de gas propano y tiene 3 calderas. Tambien se abastece de energia a través de unas placas solares.'}

{'es-ES': 'Se vende gran casa unifamiliar de piedra de 3 plantas en Ziordia. Consta de planta baja, primera planta y planta superior. La planta baja se distribuye en un vestíbulo muy amplio, habitación, salón comedor con chimenea, cocina, baño con ducha, garaje y almacén. En la primera planta cuatro amplias habitaciones, gran cocina, 2 baños y salón comedor. El ático un espacio vacío con la posibilidad de adecuarlo como cada uno quiera. La propiedad está estudiando la manera más optima de añadir como opción la segregación de una parte del terreno urbano del que se dota la finca y la opción más generosa, evidentemente, sería la adquisición de la casa con todo el terreno adyacente con la posibilidad incluso de darle un destino para turismo y hostelería con una preciosa y antigua casa central y otros edificios complementarios. El precio del terreno no está incluido en la venta del inmueble. 

Ziordia es una población muy bonita del valle de Sakana y se encuentra en un punto estratégico entre San Sebastian, Vitoria y Pamplona.

Consulte sin compromiso.'}

{'es-ES': 'Piso en Castejón, junto a Plaza España
 
 En esquina, con 2 habitaciones y 1 baño
 
 Aire acondicionado'}

{'es-ES': 'Espectacular chalet en Elcano, sobre una parcela de 3.500m. se levanta esta propiedad construida con materiales nobles tanto exterior como interiormente, rodeada de un cuidado y discreto jardín con una amplia piscina, la entrada exterior ya nos da pistas de su calidad.

Distribuida en tres plantas y con 1.053m. útiles, semisotano, planta baja y 1º, dispone de dos salones, vestibulo de entrada con su escalera principal, ocho habitaciones, ocho baños, un amplísimo txoko, comedor exterior de verano y multiples dependencias varias.

Realizamos como se ve una descripción mínima puesto que una visita nos podrá dar una idea real de la propiedad.'}

{'es-ES': 'Casa en venta en Murieta, para terminar de construir en su interior.
Dispone 3 plantas.

Posibilidad de poder realizar vivienda, hotel rural o casa rural.'}

{'es-ES': 'Precioso ático en Lago de Barañain, con todos los servicios a un paso. Consta de dos dormitorios, cocina, salón, baño y aseo (en dormitorio principal). 2 terrazas, con orientaciones Este y Oeste, una de ellas con sistema de cerrado con cristalera corredera. La terraza principal, de 30 m² permite disfrutar de sol y vistas y dispone además de una zona cerrada acristalada para aprovecharla todo el año. Garaje y trastero en el mismo edificio.
 Una vivienda especial, te interesa ???

 (Las superficies expresadas en esta página tienen carácter descriptivo y son aproximadas. Muebles no incluidos. Vehículo no incluido. Datos meramente informativos,  sin valor contractual.. El PVP indicado no incluye impuestos, gastos de transmisión).'}

{'es-ES': 'Finca rustica en Salinas zona Crta. salinas-monovar, 300 m. de superficie, 500000 m. superficie parcela, 7 habitaciones dobles, 2 baños, propiedad semireformado, carpintería exterior de madera.
Extras: arma. empotrados, chimenea, deposito agua, despensa, luminoso, mirador, terraza, trastero, arboles, autobuses, centros medicos, colegios, montaña, rural, vistas despejadas, con unas 30 ha. de almendros y olivos en agricultura ecologica y unas 20 ha. de monte, con vistas espectaculares.

 Venta: 625.000 €'}

{'es-ES': 'Piso amplio y luminoso, con infinidad de posibilidades, reformado situado en el centro de Tudela.

 La vivienda consta de gran salón-comedor, cocina independiente, gran terraza acristalada, 3 amplias habitaciones y baño completo recientemente reformado. Toda la vivienda es muy luminosa pues dispone de balcones a la calle.

 Piso muy bien situado en pleno centro de Tudela, cercano a todos los servicios, a un minuto andando de los colegios Compañía de María y Elvira España, a un minuto del Centro de Salud Gayarre y a tres minutos andando de la Plaza Nueva.'}

{'es-ES': 'Estupendo unifamiliar en Puente La Reina construido con materiales de primera calidad. 

Está distribuido en 4 plantas con garaje y trastero. Además de txoko. Aparte dispone de espacio extra para poder construir nuevas habitaciones. 
Posibilidad de hacer alquiler con opción a compra. Dejando una entrada de un 10% al inicio de la operación.'}

{'es-ES': 'Gran piso de 130 m2 útiles y 25 m2 de terraza, con vistas a la Casa del Reloj. Muy muy cuidado, luminoso, con buena orientación y amplios espacios, situado en el Paseo del Queiles de Tudela.

 La vivienda se distribuye en hall, salón-comedor y cocina equipada, ambos con acceso a la terraza, 4 amplias habitaciones con armarios empotrados y dos baños completos.

 2 plazas de garaje opcionales.'}

{'es-ES': 'Vivienda con muchas posibilidades o hacer una pequeña promoción, en el centro de Tudela .

 La parcela tiene una superficie de  265 m2 de parcela, 334.92 m2 utiles .

 Muy bien situada  y rodeada de todos los servicios .'}

{'es-ES': 'Vivienda unifamiliar aislada situada en el municipio de Funes, provincia de Navarra. 

La vivienda se compone de tres alturas y se encuentra distribuida en varias estancias y dependencias, pendientes de adecuar. 

Ubicada en un entorno rural, tranquilo y con pequeños servicios y comercios cercanos, es ideal para quien busca una vida tranquila y fresca. Buenas comunicaciones y cercano a núcleos de la provincia más relevantes.'}

{'es-ES': 'Apartamento en Peralta zona Centro, 94 m. de superficie, (superficie 29,48),salon-cocina, 2 habitaciones dobles,  un baño,  un aseo, propiedad nueva, orientación norte sur, suelo de parquet flotante, carpintería exterior de aluminio.
Extras: agua, aire acondicionado  (frio/ calor), ascensor, luminoso, luz, ojos de buey, puerta blindada (puerta de segurudad), terraza (29,48 m2), todo exterior, trastero (trastero situado en planta baja de 7 m2), video portero (videoportero color), arboles, centros comerciales, colegios

 Venta: 146.569 €'}

{'es-ES': 'Fantástico unifamiliar adosado en Martiket.

Vivienda distribuida en planta baja con cocina independiente, amplio salón-comedor, aseo y garaje donde se encuentra el ascensor. En planta primera encontramos 4 habitaciones y 2 baños completos. En la parte superior de una de las habitaciones hay un amplio disponible. 
Aire acondicionado en salón y habitaciones. Porche cerrado tanto en la parte delantera como en el jardín para poder aprovechar todos los rincones de la vivienda. El jardín cuenta con riego automático.'}

{'es-ES': 'Casa Centrica en Funes de 287 m. superficie parcela, 5 habitaciones,  un baño, propiedad para reformar, orientación norte sur, suelo de baldosa, carpintería exterior de madera.
Extras: autobuses, céntrico, centros médicos

 Venta: 165.000 €'}

{'es-ES': 'Se vende ático en Peralta con una superficie de  81 metros cuadrados. Dispone de 3 habitaciones, cocina, salón y 2 baños.  La orientación de la vivienda es norte sur. La carpintería exterior es de pvc. Dispone de dos amplias terrazas con magnificas vistas.
 Extras: trastero y garaje incluido. INFÓRMATE!!!!


 Venta: 115.000 €'}

{'es-ES': 'Se vende casa unifamiliar en Funes. La vivienda se compone de tres plantas estando la planta baja destinada para garaje. La planta primera se distribuye en escalera, baño, salón y cocina. La entrecubierta dispone de una estancia de 33 metros cuadrados.
Extras: trastero, garaje  incluído

 Venta: 80.000 €'}

{'es-ES': 'La promoción inmobiliaria “Casa Mendoza” en Tafalla (Navarra). Es un impresionante edificio clásico de la mejor arquitectura del momento para hacer de su hogar un espacio único e irrepetible, para que su familia disfrute verdaderamente de un hogar confortable en pleno centro de la localidad del Cidacos, a escasos metros de la Plaza Navarra y del Ayuntamiento de la localidad.

Se trata de un edificio de viviendas en régimen libre, de rehabilitación integral, respetando las impresionantes zonas comunes. 16 viviendas de 2 y 3  dormitorios. Viviendas únicas de ensueño, zonas comunes  que confieren al edificio una personalidad irrepetible. Plazas de aparcamiento disponibles y trastero por cada vivienda; Casa Mendoza integra todo en un conjunto residencial que se adaptará perfectamente a sus necesidades y las de su familia.

Acabados de máxima calidad, materiales de última generación, espectaculares fachadas, que convierten el conjunto arquitectónico en un referente de la zona y localidad. Su inversión está asegurada, porque la calidad perdura y se revaloriza mientras que Vd. la disfruta.'}

{'es-ES': 'Adosada en Falces zona Centro, 98 m2 de superficie, 55 m2 superficie parcela, 4 habitaciones, 2 baños,  un aseo, propiedad en buen estado, carpinteria interior de madera, suelo de gres, carpintería exterior de aluminio.
 Extras: calefacción, garaje  incluido, parking incluido

 Venta: 70.000 €'}

{'es-ES': 'Se vende piso muy luminoso, totalmente reformado en el barrio de la Rochapea, a tan solo 15 minutos del Casco Antiguo de Pamplona caminando por el rio y a tan solo 15 minutos del ascensor. En una zona con todos los servicios necesarios. La vivienda dispone de salón, cocina, 2 habitaciones y un baño. Orientación: Norte- Sur

 EXTRAS: Ascensor
 PRECIO: 165.000€'}

{'es-ES': 'Promoción con obra paralizada en terreno de 800 m2, y edificabilidad sobre rasante de 1542 m2 para un conjunto de 7 viviendas tipo triplex y un local comercial. El % de obra ejecutada se estima en 83%.

“Inmueble en precomercialización de reciente entrada en cartera y respecto el que se están efectuando tareas de evaluación previa sobre su situación, para cualquier información adicional a la mostrada, rogamos se pongan en contacto, a medida que avancen las tareas de clasificación se ampliará la información mostrada en web” 

Se hace constar expresamente&nbsp; que la política comercial de la propietaria se fundamenta, entre otros, en principios de igualdad de oportunidades&nbsp;&nbsp;para todos los potenciales compradores y transparencia total y absoluta; por lo que todos los inmuebles en comercialización deben permanecer publicitados en los diferentes portales inmobiliarios durante un plazo mínimo de&nbsp;12 días (20 días para el caso de inmuebles con precio igual o superior a 500.000€)&nbsp;&nbsp;después de su cambio de&nbsp;&nbsp;precio&nbsp; o de&nbsp; inicio de la comercialización. Por tanto, no se tramitará ninguna&nbsp;oferta de compra hasta que no haya transcurrido dicho plazo de transparencia, y ello con la finalidad de dar un tratamiento equitativo a las ofertas que se pudieran presentar'}

{'es-ES': 'Piso en Tudela zona Queiles, 101.00 m. de superficie, 25.16 m2 de salón, 26.00 m2 de terraza, 3 habitaciones dobles, 2 baños, propiedad en obra nueva, orientación suroeste, parquet.
 Extras: acceso pmr, agua, ascensor, calefacción, jardín, luminoso, luz, terraza, trastero, videoportero, autobuses, árboles, centros comerciales, centros médicos, colegios, supermercados, vistas despejadas, zonas infantiles, garaje  incluido, parking incluido

 Venta: 180000 €'}

{'es-ES': 'Piso para REFORMA INTEGRAL, en el centro de Tudela, consta de 4 habitaciones y 2 baños.
Calefacción y agua cliente central. Muy luminoso y con muchas posibilidades.

Salón y 2 habitaciones dan hacia la plaza Sancho el Fuerte, resto hacia patio interior.'}

{'es-ES': 'Inmobiliaria Sarasate de Estella-Lizarra presenta;

Casa en Dicastillo, pequeña pero coqueta, de 146m2 en total y 58m2 de planta. La vivienda consta de 1 baño completo y sala en la planta baja, cocina, terraza-sala y aseo y habitación en la primera planta y 2 habitaciones más bajo cubierta.
(Se está tramitando la cédula de habitabilidad, puede que no la tenga, solicitar mas información en la agencia)
La vivienda se encuentra en muy buenas condiciones y está muy bien cuidada. Ubicada en el centro del pueblo a 1 paso de la plaza y de todos los establecimiento.

La autovía Pamplona-Logroño está a tan solo 10 minutos en coche. Si lo que buscas es un pueblo con todos los servicios, sin duda Dicastillo y esta casa no te defraudarán!!'}

{'es-ES': 'Gorraiz - fantastico chalet independiente de 900 m² utiles en parcela de 2.000 m². Construido en dos plantas y sotano.

Espectacular diseño, grandes espacios, habitaciones en planta baja y primera, piscina integrada en la vivienda.

Un chalet en la zona mas elevada de gorraiz, discreto y exclusivo.'}

{'es-ES': 'Un piso en muy buen estado de conservación, en el corazón de ... ¿Necesitas algo más para comenzar tu nueva vida?

 Si todavía no estás seguro, mira las fotos. Sí. Aquí está: ésta es la vivienda que estás buscando. Un piso con un buen salón comedor, una cocina amplísima y tres grandes dormitorios llenos de luz. Porque el exterior de esta vivienda también es una parte importante ya que está situada en plena Calle Mayor, siendo la trasera del edificio muy cerquita del Batán de Villava, en pleno paseo del Arga, una gran zona verde de esas que es necesario tener cerca para escapar del día a día. Y si esto no es suficiente también tienes cerca bares donde tomarte algo con tus amigos, tiendas donde hacer la compra etc...

 ¿Cuándo quieres que quedemos y empecemos a dar el primer paso de tu nueva vida?'}

{'es-ES': 'Piso en Tudela zona Queiles, 80.68 m. de superficie, 42.94 m2 de salón, 62 m2 de terraza,  una habitación doble y  una habitación sencilla,  un baño, propiedad en obra nueva, orientación suroeste, parquet.
 Extras: acceso pmr, agua, ascensor, calefacción, jardín, luminoso, luz, terraza, trastero, videoportero, autobuses, árboles, centros comerciales, centros médicos, colegios, supermercados, vistas despejadas, zonas infantiles, garaje  incluido, parking incluido

 Venta: 185.000 €'}

{'es-ES': 'Rebajada! Casa antigua para reformar, con planta baja, primero y sabayao, de 82 m2 cada una.

En el centro de Garde: entre el frontón y el ayuntamiento.

Precio: 43.000 Eur negociables.'}

{'es-ES': 'ZONA CENTRO DE TUDELA

 3 DORMITORIOS, AMPLIO SALÓN, COCINA, 2 BAÑOS Y TERRAZA.

 GASTOS COMUNIDAD CON PORTERO, CALEFACCION Y ACS.'}

{'es-ES': 'Piso en Tudela zona Azucarera, 70 m2. de superficie, 2 habitaciones dobles,  1 baño, propiedad en buen estado, cocina equipada, carpinteria interior de madera, suelo de parquet, carpintería exterior de aluminio / climalit.
Armarios empotrados, garaje y trastero  incluído


Gastos de comunidad: 41 Eur.'}

{'es-ES': 'SÓTANO - Garaje + Txoko + Aseo;
 PLANTA BAJA - Hall + distribuidor + cocina + salón-comedor + aseo + habitación con baño incorporado + terraza; 
PLANTA PRIMERA - distribuidor + 4 dormitorios uno de ellos con baño incorporado, 2 baños y terraza.
Instalación domótica,  sin amueblar, calefacción de gas, aire acondicionado, alarma y persianas automáticas, con excelentes vistas y calidades.
POSIBILIDAD DE ALQUILER O DE ALQUILER CON OPCIÓN DE COMPRA.'}

{'es-ES': 'Promoción de 45 viviendas libres, con garaje y trastero, situadas en Mutilva (Navarra), junto al parque de Entremutilvas. Encuadrado en un edificio de planta baja y cuatro alturas, distribuido en viviendas de 2, 3 y 4 dormitorios, con espaciosas y generosas terrazas orientadas al sur-oeste, especialmente en planta baja, con superficies de 50 m2 hasta 100 m2. Gracias a su orientación sur-oeste, se aprovecha al máximo la luminosidad, separando la zona de noche y día para ofrecer mejor funcionalidad.
Todas las viviendas cuentan con un garaje y un trastero excepto las viviendas de 4 dormitorios que incluyen 2 garajes. La situación, orientación y características del edificio, garantizan la doble orientación que favorece una óptima ventilación e iluminación. Belatia proporciona un equilibrio perfecto entre esparcimiento y servicios al ofrecer numerosas zonas verdes, instalaciones deportivas, centros educativos y centros comerciales y de ocio en las proximidades.							
							
							
							
							
							
'}

{'es-ES': 'Promoción de 45 viviendas libres, con garaje y trastero, situadas en Mutilva (Navarra), junto al parque de Entremutilvas. Encuadrado en un edificio de planta baja y cuatro alturas, distribuido en viviendas de 2, 3 y 4 dormitorios, con espaciosas y generosas terrazas orientadas al sur-oeste, especialmente en planta baja, con superficies de 50 m2 hasta 100 m2. Gracias a su orientación sur-oeste, se aprovecha al máximo la luminosidad, separando la zona de noche y día para ofrecer mejor funcionalidad.
Todas las viviendas cuentan con un garaje y un trastero excepto las viviendas de 4 dormitorios que incluyen 2 garajes. La situación, orientación y características del edificio, garantizan la doble orientación que favorece una óptima ventilación e iluminación. Belatia proporciona un equilibrio perfecto entre esparcimiento y servicios al ofrecer numerosas zonas verdes, instalaciones deportivas, centros educativos y centros comerciales y de ocio en las proximidades.							
							
							
							
							
							
'}

{'es-ES': 'Preciosa vivienda en Calle Mayor. Tiene 139 m2 construidos y se encuentra en perfecto estado, para entrar a vivir. Toda casa es exterior y tiene muchisima luz. Consta de tres plantas, distribuidas de la siguiente manera;
Planta calle: Hall   Bodega en ella hay posibilidad de montar cocina   Baño   Pequeña despensa.
1ª Planta: Amplio salon todo amueblado y con Balcon con vistas al Moncayo   Cocina totalmente equipada con bancada alta y baja, vitro, nevera, microndas, horno. Separada del salon por una preciosa pared de paves.
2ª Planta: Hall   Tres dormitorios (todos amueblados con cama, armario y mesillas) y los tres exteriores   amplio baño tambien con ventana.
3ª Planta: Pequeño desvan abuhardillado.
¡¡EXCELENTE OPORTUNIDAD! . No la dejes pasar, merece la pena visitar el inmueble para verlo!!'}

{'es-ES': 'Casa para reformar o Terreno en zona Virgen de la Cabeza con muchas posibilidades.

 La parcela tiene una superficie de 178,32 metros cuadrados donde actualmente hay una edificación construida.

 Muy bien situada junto a una de las zonas verdes más grandes de Tudela, el Parque Baztán, Barcelosa y Corazón de Jesús, y rodeada de todos los servicios.'}

{'es-ES': 'Casa zona Ayuntamiento, 100 m2 de superficie, 3 habitaciones y 1 baño.
 Buhardilla y patio con barbacoa


 *Necesita pequeña reforma'}

{'es-ES': 'SE VENDE  casa rústica en Barillas IDEAL PARA CASA RURAL.

Gran parcela de 1.046m2 divididos entre vivienda 480m2 construidos y zona de jardín muy amplia.

La casa consta de numerosas estancias, 3 salones con chimeneas, comedor, cocina, 8 dormitorios , 5 baños, buhardilla.'}

{'es-ES': 'Casa Rustica en el pueblo Erasun navarra que se sitúa en la plaza del pueblo. 54km de Pamplona y a 18km de Santesteban. Sitio tranquilo con preciosas vistas en la parte posterior de la casa hacia el monte.

Se vende primer piso de 140m2, bajo de 90m2 y terreno detrás de la casa 80m2 y 150m2 de huerta. Toda la casa esta amueblada y equipado para entrar a vivir, cuatro dormitorios, dos baños, amplio salón y amplia cocina. Tiene una terraza larga y una chimenea en el salón. El suelo y las puertas son de castaño. Tejado nuevo hecho hace 6 años. En la cocina hay una cocina económica de leña donde calienta toda la casa mediante calefacciones.

Se envía mas fotos y información desde whatsapp'}

{'es-ES': 'Casa adosada de nueva construcción de 178 m2 , materiales de primera calidad , garaje , salón , cocina  3 dormitorios , 2 baños y terraza de 40 m2.
 No pierdas la oportunidad de estrenar tu propia vivienda en el centro de Milagro .

 Venta: 165.000 €'}

{'es-ES': 'Vivienda en régimen de VPO de 2 habitaciones, 2 baños, salón y cocina situada en el municipio de Marcilla, provincia de Navarra. 

Piso exterior y muy luminoso situado en una zona tranquila con zonas ajardinadas y parque infantil en los alrededores y bien comunicada, a apenas 1 Km. de la salida de la autopista. Le corresponden como anejos una plaza de garaje amplia y un trastero de 15 m2. 

Dispone de calefacción y ACS individuales con caldera de gas natural y radiadores de aluminio. La carpintería exterior es de aluminio con cristal climalit y ventanas oscilobatientes. Carpintería interior de madera contrachapada y suelos de cerámica.'}

{'es-ES': 'Piso en Tudela zona Queiles, 66.10 m. de superficie, 21.69 m2 de salón, 21.00 m2 de terraza,  una habitación doble,  un baño, propiedad en obra nueva, orientación suroeste, parquet.
 Extras: acceso pmr, agua, ascensor, calefacción, luminoso, luz, terraza, trastero, videoportero, autobuses, árboles, centros comerciales, centros médicos, colegios, supermercados, vistas despejadas, zonas infantiles, garaje  incluido, parking incluido

 Venta: 145000 €'}

{'es-ES': 'Ático en Zona Centro con 30 m2 de terraza,  2 habitaciones y 1 baño.

 Aire acondicionado, Calf Central, Armarios empotrados y trastero (en planta de vivienda)

 Plaza de Garaje'}

{'es-ES': 'Vivienda exterior bien situada junto al Paseo Invierno. 

 Consta de hall, salón-comedor, cocina independiente, 4 habitaciones y baño.

 Muy bien situada en el Centro de Tudela, junto al Paseo Invierno, rodeada de todos los servicios y muy bien comunicada por transporte urbano.'}

{'es-ES': 'Piso situado en la planta planta 2 de un edificio de dos alturas sobre rasante, con ascensor, ubicado en la localidad de Miranda de Arga, en la provincia de Navarra.

La vivienda está compuesta por tres dormitorios, un baño, salón-comedor y cocina.
Accedes al Hall, a la izquierda tenemos una habitación con armario empotrado a la calle, seguida de otra habitación a la misma calle, a la derecha una despensa -trastero, seguida otra habitación a la calle, a  derecha el baño con plato de ducha, a la izquierda cocina semi amueblada a calle y salón en esquina con balcón a las dos calles.'}

{'es-ES': 'Vivienda con 124 metros útiles e infinitas posibilidades. Muy amplia y luminosa, con buena orientación.

 Consta de hall, salón-comedor, cocina, 4 habitaciones, baño, aseo y 2 balcones exteriores.

 Bien situada, rodeada de todos los servicios y próxima al centro de Tudela.'}

{'es-ES': 'Chalet en Obanos. 360 m² Utiles.
 
La vivienda se explota como casa rural con muy buena ocupación, ideal como vivienda habitual para el comprador además de un medio de vida.

 Cuatro dormitorios, cinco baños, fantástico txoko. Terrazas en cada planta, solárium. Terraza acristalada para invierno y terraza de verano, con vistas a la piscina. Espectaculares vistas desde toda la vivienda. Parcela de fácil acceso de 800 m². Huerta y jardín muy cuidado. ¡Oportunidad! Se admite permuta y alquiler. distribución: salón de 40 m2 comedor de 60 m2 5 habitaciones dobles jardín de 500 m2 la casa dispone de: cocina eléctrica vitrocerámica barbacoa paredes del baño de cerámica suelo del baño de cerámica ducha hidromasaje ventanas de pvc portero automático patio bodega.'}

{'es-ES': 'OBRA NUEVA  EN TORRES DEL RIO (NAVARRA), ADOSADO EN DOS PLANTAS CON 4 DORM., BAÑO Y ASEO, COCINA INDEPENDIENTE, CALEFACCIÓN INDV. DE GAS.

EDIFICADO ESTRUCTURA, FACHADA, TEJADO, DISTRIBUCIONES CON POSIB. DE MODIFICAR. HAY PROYECTO A FALTA DE FIN DE OBRA. POSIBILIDAD DE COMPRAR CON TODO ECHO (CONSULTAR PRECIO).

